import React, { useState } from "react";

export default function Forecast() {
  const [forecastPeriods, setForecastPeriods] = useState([]);

  return (
    <>
      <div>Forecast</div>
      <input type="text" />
      <button>Search</button>
      
      {forecastPeriods.map((forecast) => {
        return <ForecastCard forecast={forecast} />;
      })}
    </>
  );
}
